import React from 'react'
import App from './App'
import Auth from './Auth'

function routes() {
    let element = useRoutes([
        {
            path: '/',
            element: <App />,
            children: [
                {
                    index: true,
                    element: <App />
                },
                {
                    path: "Home",
                    element: <App />
                },
                {
                    path: "Auth",
                    element: <Auth />
                }

            ]
        }
    ])
}


export default routes
